import { useState } from "react";

function Button() {
  const [cnt, setCount] = useState(0);

  function handleClick() {
    setCount(count + 1);
  }

  return(
    <button onClick={handleClick}>
      Clicked {count} times
    </button>
  );
}

function App() {
  return (
    <div>
      <Button />
      <Button />
    </div>
  );
}
export default App;
